window.bookSummaryJSON = "<p><b>Final year, final battle</b></p> <p>I thought my biggest problem was being kicked off campus, but I'd rather trade my blazer for a skirt than an orange jumpsuit.</p> <p>There's a killer on campus, and they think it's me. I have my boys on my side, but this might be one fight we can't win.</p> <p>Someone is determined to bring us down, but with enemies on all sides, the suspects are endless, and I'm running out of time.</p> <p>I'm not the only one who came to Breakbattle with a plan.</p> <p>A legacy of deception, sabotage, and death will no longer be ignored, but this time the innocent may pay the price.</p> <p><b>The Elites is a reverse-harem high school bully romance. This is year four and the final book in the series. It features language, dark themes, and sexual scenes. If you're cool with that, dive in!</b></p>"; 
